import React from "react";
import "./flight.css";

const FlightResult = ({ flightResults }) => {
  return (
    <div>
      {flightResults && (
        <div className="flight-results">
          <h2>Flight Search Results</h2>
          {flightResults && (
            <div className="flight-card">
              {flightResults.data.flights.map((flight, index) => (
                <div key={index}>
                  <p>logo:{flight.segments[0].legs.operatingCarrier.logoUrl}</p>
                  <p>
                    Flight Name:{" "}
                    {flight.segments[0].legs.operatingCarrier.displayName}
                  </p>
                  <p>
                    Flight Number: {flight.segments[0].legs[0].flightNumber}
                  </p>
                  <p>
                    Departure Time:{" "}
                    {flight.segments[0].legs[0].departureDateTime}
                  </p>
                  <p>
                    Arrival Time: {flight.segments[0].legs[0].arrivalDateTime}
                  </p>
                  <p>
                    Link Provider to purchase:{" "}
                    {flight.purchaseLinks[0].purchaseLinkId}
                    url :{flight.purchaseLinks[0].url}
                  </p>
                  <hr className="divider" />
                </div>
              ))}
            </div>
          )}
        </div>
      )}
    </div>
  );
};

export default FlightResult;
